export default function CardMeta({title,content}){
    return(
        <div
        style={{lineHeight:0.4,marginBottom:20}}
        >
            <span style={{opacity:0.5, fontWeight:"bold"}}>{title}</span>
            <h1>{content}</h1>
        </div>
    );
}
